svg.script:
/**
 * Encapsulate all of my code inside of an anonymous function to avoid namespace conflicts.
 * 
 *  Actually not a must for SVGs embedded via `<object>` (the JS code from the SVG and that of the embedding page exist separately.)
 *  But, in the event the SVG was integrated inline (e.g.: via PHP's file_get_contents()), we'll be glad the code is encapsulated to avoid conflicts.
 *
 */
(function() {

	/** Maintain a reference to this object, even as the context is changing **/
	var self = this;



	/********************* PROPERTIES *********************/
	this.firstBlood = false; // i.e.: did the user interact with the document yet?
	this.lastPlayedSound = null;
	this.mappings = { // Keyboard shortcuts

		// Based on KeyName:
		'simple': {
			p: 'consonant_pig',
			t: 'consonant_turtle',
			k: 'consonant_cat',
			b: 'consonant_bear',
			d: 'consonant_dog',
			g: 'consonant_goat',
			f: 'consonant_frog',
			v: 'consonant_beaver',
			s: 'consonant_snake',
			z: 'consonant_zebra',
			w: 'consonant_wolf',
			l: 'consonant_lion',
			m: 'consonant_mouse',
			n: 'consonant_dinosaur',
			r: 'consonant_rabbit',
			j: 'consonant_yak',
			h: 'consonant_horse'
		},
		'shift': {
			s: 'consonant_panther',
			z: 'consonant_feather',
			n: 'consonant_penguin'
		},

		// Based on KeyCode:
		'alt': {
			KeyS: 'consonant_sheep',
			KeyZ: 'consonant_television'
		},
		'altshift': {
			KeyS: 'consonant_chicken',
			KeyZ: 'consonant_giraffe',
		},
		'digits': {
			Digit1: 'vowel_green',
			Digit2: 'vowel_blue',
			Digit3: 'vowel_pink',
			Digit4: 'vowel_wood',
			Digit5: 'vowel_dust',
			Digit6: 'vowel_red',
			Digit7: 'vowel_purple',
			Digit8: 'vowel_mauve',
			Digit9: 'vowel_sand',
			Digit0: 'vowel_coffee'
		},
		'shiftdigits': {
			Digit1: 'diphthong_jade',
			Digit2: 'diphthong_lime',
			Digit3: 'diphthong_brown',
			Digit4: 'diphthong_gold',
			Digit5: 'diphthong_turquoise'
		}
		// FYI: in terms of letters on the keyboard, only q, y, x, c are left.
	};



	/********************* METHODS *********************/

	/** getTranslate & setTranslate
	 *
	 * About constants:
	 * 	baseVal[i].type returns a constant.
	 * 	SVGTransform.* define the constants.
	 * See https://developer.mozilla.org/en-US/docs/Web/API/SVGTransform
	 * Also got pointers from http://stackoverflow.com/a/10358266/1717535
	 */
	this.getTranslate = function ( element ) {

		/** Figure which transform element is the translate **/
		var translateIndex = null;
		for ( var i = 0; i < element.transform.baseVal.numberOfItems; i++ ) {
			if ( element.transform.baseVal.getItem(i).type == SVGTransform.SVG_TRANSFORM_TRANSLATE ) {
				translateIndex = i;
				break;
			}
		}

		return { x: element.transform.baseVal.getItem(0).matrix.e, y: element.transform.baseVal.getItem(0).matrix.f };
	}
	this.setTranslate = function( element, x, y ) {

		/** Figure which transform element is the translate **/
		var translateIndex = null;
		for ( var i = 0; i < element.transform.baseVal.numberOfItems; i++ ) {
			if ( element.transform.baseVal.getItem(i).type == SVGTransform.SVG_TRANSFORM_TRANSLATE ) {
				translateIndex = i;
				break;
			}
		}

		/** Update the translate values **/
		element.transform.baseVal.getItem(i).setTranslate( x, y );
	}

	/**
	 * showHalo
	 * We use userinitiated = false to trigger the halo on pageload, but stop it on mouseenter.
	 */
	this.showHalo = function ( element, userinitiated ) {

		/** Default parameter **/
		userinitiated = (typeof userinitiated !== 'undefined') ?  userinitiated : true;

		/** Stop the initial animations shown on page load **/
		if ( userinitiated  &&  self.firstBlood == false ) {
			document.querySelector( '#consonant_pig .phoneme' ).style.animation = '';
			var labels = document.querySelectorAll( 'g.label g' );
			labels[0].style.animation = '';
			labels[1].style.animation = '';

			self.firstBlood = true; // placing it here is debatable (could also place it on the trigger's click), but fine for our current purpose
		}

		/** Show the halo **/
		var translation = self.getTranslate( element );
		self.setTranslate( document.querySelector( '#halo' ), translation.x, translation.y );
		document.querySelector( 'svg' ).unpauseAnimations();
		document.querySelector( '#halo' ).style.visibility = 'visible';

		/** Let's bounce! **/
		var id = element.querySelector( 'metadata' ).textContent;
		var phoneme = document.querySelector( '#' + id ).querySelector( '.phoneme' );
		phoneme.style.animation = 'bounceAlt 3.5s linear infinite';

		/** Run the rotating words animation for that sound **/
		var labels = document.querySelectorAll( '#' + element.querySelector( 'metadata' ).textContent + ' g.label g' ), j;

		for ( j = 0 ; j < labels.length ; ++j )  {
			switch ( j ) {
				case 0:
					labels[j].style.animation = 'rotateWord 7200ms linear infinite 0s';
					break;
				case 1:
					//labels[j].style.animation = 'rotateWord 7200ms linear infinite 2400ms';
					labels[j].style.animation = 'rotateWord 7200ms linear infinite 3600ms';
					break;
				case 2: // this would be the translation
					labels[j].style.animation = 'rotateWord 7200ms linear infinite 4800ms';
					break;
				default:
					//console.log( 'more than I bargained for!' );
			}
		}

	}

	/**
	 * hideHalo
	 *
	 */
	this.hideHalo = function ( element ) {
		/** Hide the halo **/
		document.querySelector( '#halo' ).style.visibility = 'hidden';
		document.querySelector( 'svg' ).pauseAnimations();

		/** Stop bouncing **/
		var phonemes = document.querySelectorAll( '#' + element.querySelector( 'metadata' ).textContent + ' g.phoneme' ), i;
		for ( i = 0 ; i < phonemes.length ; ++i )  {
			phonemes[i].style.animation = '';
		};

		/** Stop the rotating words animation **/
		var labels = document.querySelectorAll( '#' + element.querySelector( 'metadata' ).textContent + ' g.label g' ), i;
		for ( i = 0 ; i < labels.length ; ++i )  {
			labels[i].style.animation = '';
		};
	}

	/**
	 * getClass
	 *
	 * Get an SVG element's class name(s).
	 * This is a basic function to handle lack of support for event.target.getAttribute on `<use>` elements in IE.
	 * If more than one class is set, this returns the string of class names separated by whitespaces.
	 */
	this.getClass = function ( element ) {
		var classname;
		try { 
			classname = element.getAttribute( 'class' );
		}
		catch ( e1 ) {
			try {
				classname = element.correspondingUseElement.getAttribute( 'class' );
			}
			catch ( e2 ) {
				classname = false;
			}
		}
		finally {
			return classname;
		}
	}

	/**
	 * playback
	 *
	 * Play some HTML audio.
	 */
	this.playback = function ( reference, type ) {

		var audio;
 		type = (typeof type !== 'undefined') ? type : 'auto';


		/** Stop the attention-seeking blinking text animation **/
		//if ( self.firstBlood == false ) {
			// old: stop the animation on the blinking text
			//document.querySelector( '#interactive' ).style.animation = '';
			//document.querySelector( '#interactive' ).style.cursor = 'auto';

			//document.querySelector( '#consonant_pig .phoneme' ).style.animation = '';

			//self.firstBlood = true;
		//}


		/** Play slow? **/
		if ( type == 'auto' ) {
			if ( self.lastPlayedSound && self.lastPlayedSound.reference == reference && self.lastPlayedSound.type == 'normal' ) {
				type = 'slow';
			} else {
				type = 'normal';
			}
		} else if ( type == 'repeat' ){
			if ( self.lastPlayedSound.type == 'phoneme' ) {
				type = 'phoneme';
			} else if ( self.lastPlayedSound.type == 'normal' ) {
				type = 'slow';
			} else {
				type = 'normal';
			}
		}
		self.lastPlayedSound = { reference: reference, type: type };


		audio = document.querySelector( '#' + reference + '_audio_' + type );
		if ( audio !== null ) {
			try { audio.currentTime=0; } catch(e) {} audio.play();
		}
	}

	/**
	 * extractDomain
	 *
	 * Extract the domain, including sub-domains.
	 * Thanks to http://stackoverflow.com/a/23945027/1717535
	 */
	this.extractDomain = function ( url ) {
		var domain;
		//find & remove protocol (http, ftp, etc.) and get domain
		if (url.indexOf("://") > -1) {
			domain = url.split('/')[2];
		} else {
			domain = url.split('/')[0];
		}

		//find & remove port number
		domain = domain.split(':')[0];

		return domain;
	}



	/////////////////////////////////// THE CONSTRUCTOR NEEDS TO COME LAST AS IT IS EXECUTED RIGHT AWAY
	/////////////////////////////////// i.e.: the constructor relies on components that need be defined *before* the constructor itself can be used.

	/********************* CONSTRUCTOR METHOD *********************/

	/**
	 * Private constructor
	 * Not a language construct.
	 * Mind `var` to keep the function private and () to execute it right away.
	 */
	var __construct = function() {

		/**
		 *
		 * Remarks:
		 *  `for` loops are used where a more modern `forEach` (applied to a NodeList) would have been more convenient to write, but enjoyed less browser support.
		 *  We pause all animations when not showing the halo. (In hope this might help save CPU on mobile.)
		 *
		 */


		/** Trigger behavior
		 *
		 */
		var triggers = document.querySelectorAll( '.trigger' ), i;
		for ( i = 0 ; i < triggers.length ; ++i ) {
			triggers[i].addEventListener( 'mouseenter', function( event ) {
				self.showHalo( this );
			});

			triggers[i].addEventListener( 'mouseleave', function() {
				self.hideHalo( this );
			});

			triggers[i].addEventListener( 'click', function( event ) {

				if ( self.getClass( event.target ) == 'phone' ) {
					type = 'phoneme';
				} else if ( event.altKey ) {
					type = 'slow';
				} else {
					type = 'auto'; /** i.e.: normal or slow, depending on context **/
				}

				self.playback( this.querySelector( 'metadata' ).textContent, type );
			} );
		};

		var phonemetriggers = document.querySelectorAll( 'use.phone' ), i;
		for ( i = 0 ; i < phonemetriggers.length ; ++i ) {

			phonemetriggers[i].addEventListener( 'mouseenter', function( event ) {
				var id = this.parentNode.querySelector( 'metadata' ).textContent;
				var phoneme = document.querySelector( '#' + id ).querySelector( '.phoneme' );
				phoneme.style.animation = 'bounce 1s linear infinite';
			} );

			phonemetriggers[i].addEventListener( 'mouseleave', function() {
				var id = this.parentNode.querySelector( 'metadata' ).textContent;
				var phoneme = document.querySelector( '#' + id ).querySelector( '.phoneme' );
				phoneme.style.animation = '';
				showHalo( this.parentNode, false ); // to resume the slow bounce animation on the phone
			});
		};


		/** Keyboard navigation
		 *
		 * Only works if the SVG has the focus. i.e.: people clicked on it before using the keyboard.
		 * Keyboard shortcuts playback phonemes if CapsLock is off, else the full normal word.
		 * Won't work (no event.code) in Safari.
		 */
		document.addEventListener( 'keydown', function( event ) {

			/** No event.code, no shortcuts. **/
			if ( event.code == null ) {
				return;
			}

			/** Prevent my own shortcuts if the user is merely attempting to use a system- or browser-specific shortcut **/
			if ( event.metaKey ) {
				return;
			}

			var keyName = event.key.toLowerCase();
			var keyCode = event.code;
			var type = event.getModifierState( "CapsLock" ) ? 'normal' : 'phoneme' ;


			/** Handle special keys. **/
			if ( event.code == 'Space' && self.lastPlayedSound ) {
				self.playback( self.lastPlayedSound.reference, 'repeat' );
			}


			/** Handle alphabetical keys. i.e.: consonants **/
			if ( event.shiftKey === false && event.altKey === false ) {
				if ( self.mappings.simple[ keyName ] ) {
					self.playback( self.mappings.simple[ keyName ], type );
				}
			} else if ( event.shiftKey && event.altKey ) {
				if ( self.mappings.altshift[ keyCode ] ) {
					self.playback( self.mappings.altshift[ keyCode ], type );
				}
			} else if ( event.shiftKey ) {
				if ( self.mappings.shift[ keyName ] ) {
					self.playback( self.mappings.shift[ keyName ], type );
				}
			} else if ( event.altKey ) {
				if ( self.mappings.alt[ keyCode ] ) {
					self.playback( self.mappings.alt[ keyCode ], type );
				}
			}


			/** Handle digit keys. i.e.: vowels, diphthongs **/
			if ( keyCode.substring(0, 5) === 'Digit' ) {
				if ( event.shiftKey === false ) {
					if ( self.mappings.digits[ keyCode ] ) {
						self.playback( self.mappings.digits[ keyCode ], type );
					}
				} else {
					if ( self.mappings.shiftdigits[ keyCode ] ) {
						self.playback( self.mappings.shiftdigits[ keyCode ], type );
					}
				}
			}

		});


		/** Auto-tag links
		 *
		 * Add custom-campaign parameters to the outgoing links in the document.
		 * This lets us enjoy nice readable data inside of Google Analytics.
		 * Only tagging outgoing links to my own domain, and not tagging anything if my own domain is serving the page.
		 *
		 *	Only using these parameters:
		 *	SOURCE -- will be the domain showing the SVG
		 *	MEDIUM -- set to `infographic`
		 *	CONTENT -- set to `api` (the short name of this document.)
		 * 	For more, see https://ga-dev-tools.appspot.com/campaign-url-builder/
		 * 
		 * Keep in mind:
		 *	`document.referrer` The webpage serving the URL.
		 *	`window.location.hostname` The domain serving this very SVG.
		 *	They will likely be different. e.g.: infographic on AWS, embedded in the blog/site of a third party.
		 *
		 */
		var links = document.querySelectorAll( 'a[*|href^="https://clickandspeak.com"]' ), i;
		for ( i = 0 ; i < links.length ; ++i ) {
			if ( document.referrer ) {
				var referrerdomain = self.extractDomain( document.referrer );
				if ( referrerdomain && referrerdomain != 'clickandspeak.com' ) {
					var value = links[i].getAttributeNS( 'http://www.w3.org/1999/xlink', 'href' );
					links[i].setAttributeNS( 'http://www.w3.org/1999/xlink', 'href', value + '?utm_source=' + referrerdomain + '&utm_medium=infographic&utm_content=ipa' );
				}
			} // else, no point creating custom links.
		};



		/** Call the user's attention on the fact the document is interactive.
		 * Will want to disable it when I take screen captures.
		 */

		// the old way: show the halo if he clicks on the word "interactive" (that used to blink.)
		document.querySelector( '#interactive' ).addEventListener( 'click', function( event ) {

			/** Show the halo only (without the rotating text) to hint to the user just where to click **/
			if ( document.querySelector( '#interactive' ).style.animation != '' ) {
				var translation = self.getTranslate( document.querySelector( '.trigger' ) );
				self.setTranslate( document.querySelector( '#halo' ), translation.x, translation.y );
				document.querySelector( 'svg' ).unpauseAnimations();
				document.querySelector( '#halo' ).style.visibility = 'visible';
			}
		} );

		// new way: animate the first sound in the chart, halo and phoneme
		showHalo( document.querySelector( '.trigger' ), false ); // i.e.: show halo on the very first trigger, which is the "pig" one.
		document.querySelector( '#consonant_pig .phoneme' ).style.animation = 'bounce 1s linear infinite'; // make it faster on page load



	}();	/* END __construct */


})();	/* END (anonymous function) */
